import './CollabFiltering.css';
import React, {Component} from "react";
import App from './App.js';

class CollabFiltering extends Component{

	is_work(){
		alert("Working, in CollabFiltering");
		window.open("./CollabFiltering.js");
		window.location.href = "./CollabFiltering.js";
	}

    render() {
     return(
      <div className="CollabFiltering">
      	<h1>Collaborative Filtering!</h1>
      </div>
     );
    }
}

const CB = new CollabFiltering();
//export default CollabFiltering;
export default CB;
